textOriginal:
Alguns feitos do Bolsonaro:

•Sancionou fundão eleitoral de R$4,9 bilhões, tendo como segundo maior beneficiado o PT, que teve acesso a R$503 milhões;

•Sancionou o juiz de garantias, proposto por Marcelo Freixo, do PSOL, e repudiado por Sérgio Moro;

•Sancionou Lei do abuso de autoridade;

•Sancionou a limitação da delação premiada, diminuindo o alcance da justiça sobre casos de corrupção;

•Sancionou pagamento de advogados com fundo partidário. Só no primeiro turno das eleições deste ano, o PT já havia utilizado 1,2 milhões de reais do fundão para pagamentos de advogados;

•Sancionou vinculação do COAF ao banco central, removendo-o do ministério da justiça e facilitando a lavagem de dinheiro;

•Assim como o PT, se opôs a CPI da lava-toga, que tinha como objetivo investigar ministros do STF;

•Nomeou Augusto Aras para a Procuradoria Geral da República. Aras, que já deu festa em sua casa para membros do PT, foi elogiado recentemente por Lula por não ser tão rígido com os investigados, diferente da lava-jato. Se Lula for eleito, petistas acreditam que Aras continuará no cargo em que Bolsonaro o colocou.

•Nomeou André Mendonça para AGU e como ministro da justiça, depois o indicou como ministro ao STF. O mesmo lançou livro colaborativo com Alexandre de Moraes (O suposto inimigo do Bolsonaro do STF), foi contra a proibição da ideologia de gênero nas escolas e a favor do juiz de garantias.

•Aliado do Senador Fernando Bezzera, ex-ministro da Dilma envolvido em corrupção. Em menos de 5 meses Fernando Bezzera mudou de apoiar o Bolsonaro para apoiar o Lula, e depois voltou a apoiar o Bolsonaro. 


•Admar Gonzaga, ex advogado e ex-ministro de Dilma. Atualmente é secretário geral do partido do Bolsonaro.

•Luiz Belmonte, vice presidente do partido que Bolsonaro tentou fundar em 2020. É ex membro do PSDB e já fez doações para o Partido Comunista do Brasil.


•Indicou Kassio Nunes Marques para o STF, advogado indicado por Dilma para cargo no ministério público.

• Assim como a Dilma, quebrou a lei orçamentária;

• Votou mais de 300 vezes a favor das mesmas pautas do PT;

"Tem que votar no Bolsonaro, senão o PT volta! 🐂🐂🐂🐂”
